import React from "react";
import Card from "./Card";

export default function Cards({ cardData }) {
  let allCourses = [];
  const getCourses = () => {
    Object.values(cardData).forEach((courseCategory) => {
      courseCategory.forEach((course) => {
        allCourses.push(course);
      });
    });
    return allCourses;
  };
  return (
    <div className="grid grid-cols-3 w-screen max-w-6xl">
      {!cardData ? (
        <div>
          <p>No Data Found</p>
        </div>
      ) : (
        getCourses().map((course) => {
          return <Card data={course} key={course.id} />;
        })
      )}
    </div>
  );
}
